import React from "react";
import * as ReactDOMClient from "react-dom/client";

let i = 0;
function inputClick() {
    console.log("Нажато " + i)
    i++;
}

function onInput() {
    console.log("Введено что-то")
    let inp = document.getElementById('input');
    inp.innerHTML = "Привет";
}

const elements = (<div>
<input idName="inputForm" placeholder="Введите логин" 
onInput = {onInput} onClick = {inputClick} />
<p idName="input"></p></div>)

const app = ReactDOMClient.createRoot(document.getElementById("app"));

app.render(elements);
